/** @format */

import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import MessageBox from '../components/MessageBox';

function AddFarm(props) {
	const [firstName, setFirstName] = useState('');
	const [lastName, setLastName] = useState('');
	const [phone, setPhone] = useState('');
	const [password, setPassword] = useState('');

	const dispatch = useDispatch();
	const submitHandler = (e) => {
		e.preventDefault();
		dispatch((firstName, lastName, phone, password));
	};
	return (
		<>
			<div className="container">
				<div className="row">
					<div className="col-md-3"></div>
					<div className="col-md-6">
						<div>
							{/* {error && <MessageBox variant="danger"></MessageBox>} */}
							{/* {userInfo && (
								<MessageBox variant="success">
									Registration is successful, Please fill in your Location.
								</MessageBox>
							)} */}
							<h4 className="card-title mt-3 text-center">Create Account</h4>
							<p className="text-center">SELECT A FARM TYPE</p>
							<form onSubmit={submitHandler}>

								<div className="form-group input-group" id="mobileNumber">
									<div className="input-group-prepend">
										<span className="input-group-text">
											<i className="fa fa-phone fa-flip-horizontal"></i>
										</span>
									</div>
									<input
										name=""
										className="form-control"
										placeholder="Phone number"
										type="text"
										onChange={(e) => setPhone(e.target.value)}
										required={true}
									/>
								</div>

								<div className="form-group">
									<button
										type="submit"
										className="btn btn-primary btn-block"
										onClick={submitHandler}
									>
										P
									</button>
								</div>
							</form>
						</div>
					</div>
					<div className="col-md-3"></div>
				</div>
			</div>
		</>
	);
}

export default AddFarm;
